import Link from 'next/link';
import styled from 'styled-components'

const HeaderWrapper = styled.div`
  background: palevioletred;
  padding: 0.25em 1em;
`;

const linkStyle = {
    marginRight: 15
  };
  
  const Header = () => (
    <HeaderWrapper>
      <Link href="/">
        <a style={linkStyle}>Latest posts</a>
      </Link>
      <Link href="/new">
        <a style={linkStyle}>New post</a>
      </Link>
    </HeaderWrapper>
  );
  
  export default Header;
